import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';  // Nếu bạn muốn sử dụng style, tạo file này sau
import App from './app';  // app.js sẽ chứa component chính của bạn
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')  // Gắn vào div có id "root" trong index.html
);

// Báo cáo các kết quả web vitals nếu cần
reportWebVitals();
